    [],nt"revision_timestamp": "2016-01-09T11:51:17.616894",nt"name": "phase-one-protected-species-valuation",nt"isopen":
    false,nt"url": null,nt"notes": "Nonmarket valuation research has produced
    economic value estimates for a variety of threatened, endangered, and rare species
    around the world.  Although over 40 value estimates exist, it is often difficult
    to compare values from different studies due to variations in study design, implementation,
    and modeling specifications.  We conducted a stated preference choice experiment
    to estimate the value of recovering or downlisting multiple threatened and endangered
    marine species in the United States.",nt"license_title": null,nt"extras":
